(8, '“ট্যালেন্ট হান্ট” কার্যক্রমে অংশগ্রহণকারী ক্ষুদে ক্রিকেটারদের একাংশ', '-ট্যালেন্ট-হান্ট--কার্যক্রমে-অংশগ্রহণকারী-ক্ষুদে-ক্রিকেটারদের-একাংশ', '<p>বাংলাদেশ ক্রিকেট বোর্ড (বিসিবি) এর ঢাকা বিভাগীয় উত্তরের কোচ ও নির্বাচক মো: জাকির হাসান সাহেবের সাথে জাতীয় ক্রীড়া পরিষদের অনুমোদন ও সার্বিক সহযোগীতায় দেশব্যাপী চলমান &ldquo;ট্যালেন্ট হান্ট&rdquo; কার্যক্রমে অংশগ্রহণকারী ক্ষুদে ক্রিকেটারদের একাংশ এবং প্রোগ্রাম বাস্তবায়ণকারী প্রতিষ্ঠান PKCSBD এর কর্মকর্তাদের একাংশ।</p>', '/storage/source/image-gallery/g15.jpg', 1, 6, NULL, NULL, NULL, '2019-11-22 12:44:15', '2019-11-22 12:44:15', NULL),
(9, 'অনুর্ধ-১৭ দলে (বা দিক থেকে তৃতীয়) রাফসান জানি!', 'অনুর্ধ-১৭-দলে--বা-দিক-থেকে-তৃতীয়--রাফসান-জানি-', '<p>বাংলাদেশ জাতীয় ক্রিকেট অনুর্ধ-১৭ দলে (বা দিক থেকে তৃতীয়) রাফসান জানি ডাক পাওয়ায় PKCSBD গভর্ণিং কাউন্সিলের পক্ষ থেকে আন্তরিক শুভেচ্ছা ও অভিনন্দন । একইসাথে, তার কারিগড় টাংগাইল জেলা ক্রিকেট কোচ কারিগড়র রূপে মহানায়ক মোঃ আরাফাত রহমানকে স্বশ্রদ্ধেয় সালাম ও আন্তরিক অভিন্দন । এই পোষ্টটির সকল পাঠকদের কাছে একটা প্রশ্ন , সাকিব আল হাসান বিশ্বের সেরা অলরাউন্ডার , তার কারিগড়কে কে কে চিনেন ? সকল খ্যাতি , সম্মান ও আর্থিকভাবে সাবলম্বি হন ক্রিকেটাররা অথচ তাদের কারিগড়রা দিনরাত অক্লান্ত পরিশ্রম করে তৈরি করেন এই আইকনদের আর কারিগড় রূপে মহানায়করা থেকে যান অবহেলিত হিসেবে। বাংলাদেশ জাতীয় ক্রিকেট অনুর্ধ-১৫/১৭/১৯ দলে যে সকল নতুন মুখ যুক্ত হবে তাদের কারিগড়দের জতীয় সম্মাননা ও আর্থিকভাবে সাবলম্বি করার ফলপ্রসু প্রকল্প হাতে নেওয়ার জন্য বিসিবি&rsquo;র সভাপতি জনাব নাজমুল হাসান পাপন সাহেব সহ সকল ক্রিকেট কর্মকর্তাদের সুদৃষ্টি আকর্ষণ করছি। হয়তো এই প্রকল্পের জন্য সারাদেশের সকল কারিগড়রা নতুন উদ্যোমে তাঁদের সর্বোচ্চ মেধা দিয়ে নতুন নতুন আইকন তৈরি করবেন সামাজিক ও জাতীয় সম্মাননার আশায় । বাংলাদেশ ক্রিকেট পাবে শত শত তামিম , মুশফিক , সাকিব , মুস্তাফিজের মতো আইকন । [ সময়ের দাবি ]</p>', '/storage/source/image-gallery/g11.jpg', 1, 6, NULL, NULL, NULL, '2019-11-22 12:45:10', '2019-11-22 12:45:10', NULL),
(10, '‘‘মাদক নয়, স্বপ্নের ভবিষ্যৎ গড়বো ক্রিকেটে ’’', '--মাদক-নয়--স্বপ্নের-ভবিষ্যৎ-গড়বো-ক্রিকেটে---', '<p>&lsquo;&lsquo;মাদক নয়, স্বপ্নের ভবিষ্যৎ গড়বো ক্রিকেটে &rsquo;&rsquo; স্লোগানে দেশব্যাপী ক্রিকেট ট্যালেন্ট হান্টের ঢাকা বিভাগের মানিকগঞ্জ জেলার &lsquo; ট্যালেন্ট হান্ট&rsquo;-১ম পর্বের অনুষ্ঠানে বাংলাদেশ ক্রিকেট বোর্ড (BCB) এর সম্মানিত পরিচালক জনাব আলহাজ্ব এ.এম. নাঈমুর রহমান (দুর্জয়) সাহেবকে সম্মাননা স্মারক উপহার দিচ্ছেন যৌথভাবে ট্যালেন্ট হান্টের সম্মানিত আয়োজক ও পরিচালক জনাব সোহেল মাহমুদ (সৈকত) এবং জাতীয় ক্রিকেট দলের সাবেক ক্রিকেটার ও ট্যালেন্ট হান্টের সিলেকশন প্যানেলের চিফ জনাব ফাহিম মুন্তাসির (সুমিত) সাহেব।<br />সম্মানিত সকল তারকাদের PKCSBD গভর্ণিং কাউন্সিলের পক্ষ থেকে আন্তরিক ধন্যবাদ।</p>', '/storage/source/image-gallery/g17.jpg', 1, 6, NULL, NULL, NULL, '2019-11-22 12:45:42', '2019-11-22 12:45:42', NULL),
(11, 'দেশব্যাপী চলছে রেজিষ্ট্রেশন', 'দেশব্যাপী-চলছে-রেজিষ্ট্রেশন', '<p>দেশব্যাপী আয়োজিত ক্রিকেটার হান্টে অংশ নিতে এখনই রেজিষ্ট্রেশন করুন। <a href=\"http://www.pkcsbd.com/?fbclid=IwAR1LsjuwQOTHuscEz5jiXrTd4PjoJqLCwV6PMQWiwTAreyU4m6rRzJEoa8Q\" target=\"_blank\" rel=\"noopener nofollow\" data-ft=\"{&quot;tn&quot;:&quot;-U&quot;}\" data-lynx-mode=\"async\" data-lynx-uri=\"https://l.facebook.com/l.php?u=http%3A%2F%2Fwww.pkcsbd.com%2F%3Ffbclid%3DIwAR1LsjuwQOTHuscEz5jiXrTd4PjoJqLCwV6PMQWiwTAreyU4m6rRzJEoa8Q&amp;h=AT1BIspy3SRmfcbOVtsVLGMtzX7EiXeqLUYw-00bMEFaBsKWsACG1Ejqv9Ps86xseGEhvVA8BCjCreDOa11dnc3xV9HigrHQT2h1fUYAsKWiDyHlk2wvu1ua9qBJQ_yXe7UVoA_MFaUFibYzrFX4WtS5NtLMioI6Hq3DqEZGd3dM8Cb-WqtrDA8oaixwZDXN_KYeUw6YLcZ8mGHQClBy7BCZRPQrpuh0MAWrVQuWaejq58yAjQnuGsi0hVeDqgYp-UJ9tMhm95Uk29a2rPN6lp5jnbizQGU7OgroQVTklnhVP2oM_SWH2ANBshgIph_5RugJn-mQWwLK7B7CJ8O-gDSkxpFzZJXZECOCb-Iamf57CC3BuIbD77ozk0XHQIEMu0x6lVBf7Et5rpivaH7xmN4Gk_lpdyohfeJmyGGske1xlKcfY1JW_Gmf0qes0qGSyvV8EQC4m3gje14LfjOPA3KeZ0p5PsVc4Skezc7ivx3dc5EelhnwKbUApHK-wuPnIfuO8vkURiB7xVlBx0pfi11twNwBjsaQu_Pdrzun5Jx3tHxBfsajYGRrokyQL_psUK8XkmPjTM3ammRLWwAr5vugxoTUmFnIq8nEthKvrIQj-qSpxbPjLQ7eocUFJG71JkCghMYDU-PCXPhIYOHq_YEi\">http://www.pkcsbd.com</a> এই ওয়েভ সাইটে প্রবেশ করে রেজিষ্ট্রেশন করুন বাটনে ক্লিক করে সকল তথ্য দিয়ে পেমেন্ট অপশনে গিয়ে বিকাশ, রকেট বা অন্য কোন মাধ্যমে ১০০ টাকা রেজিষ্ট্রেশন ফি সম্পূর্ন করুন। রেজিষ্ট্রেশন সম্পূর্ন হলে অটোমেটিক এসএমএস এর মাধ্যমে নিশ্চিত করা হবে আপনার আইডি নম্বর। এসএমএস এর মাধ্যমে কনফার্মেশন না পেলেই বুঝতে হবে আপনার রেজিষ্ট্রেশনটি সম্পূর্ন হয়নি।</p>', '/storage/source/image-gallery/g11.jpg', 1, 6, NULL, NULL, NULL, '2019-11-22 12:46:08', '2019-11-22 12:46:08', NULL),
